import React from "react";
import { SecondaryButton } from "../../Styled_Components/Buttons";
import "./BagPopUp.css";
const BagPopUp = () => {
  return (
    <div className="BagPopUp">
      <img
        src="/imges/emptyBagMesseg.svg"
        alt="emptyBag"
        className="emptyBag"
      />
      <SecondaryButton isActive={true}>Order history</SecondaryButton>
    </div>
  );
};

export default BagPopUp;
